import axios from "axios";
import { SET_GRID_SIZE } from "./types";

export const setGridSize = dimensions => {
	console.log(dimensions);
	return {
		type: SET_GRID_SIZE,
		payload: dimensions
	};
};

export const toggleModal = modalInfo => {
	console.log(modalInfo);
	let active = modalInfo;
	return {
		type: TOGGLE_MODAL,
		payload: active
	};
};
